import { Injectable } from '@angular/core';
import { Observable } from 'rxjs';
import { CampaignRepositoryPort } from '../../domain/ports/out/campaign-repository.port';
import { UploadResponseDto } from '../../domain/models/campaign.model';

@Injectable({
  providedIn: 'root'
})
export class UploadCampaignUseCase {
  constructor(private campaignRepository: CampaignRepositoryPort) {}

  execute(file: File): Observable<UploadResponseDto> {
    return this.campaignRepository.uploadCampaigns(file);
  }
}
